    "Stillwater National Wildlife Refuge, Stillwater Wildlife Management Area, Anaho
    Island National Wildlife Refuge and Fallon National Wildlife Refuge: Narrative Report:
    1965",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T22:20:16.946965",nt"name":
    "stillwater-national-wildlife-refuge-stillwater-wildlife-management-area-anaho-island-natio-88b57",nt"isopen":
    false,nt"url": null,nt"notes": "The Fallon, Stillwater and Anaho Island
    National Wildlife Refuges are located in northwest Nevada and are administered by
    the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
    Wildlife Management Area (SWMA). Water at Stillwater in 1965 was abundant. A number
    of significant events took place in 1965 which had an effect on the future water
    supply on the marsh including the temporary approval of a water distribution compact
    and several meetings involving interested persons and agencies.  Better water management
    has led to a record year of increased waterfowl populations. Botulism conditions
    compared to those of 1964 are much more favorable.  Construction consisted mainly
    of minimum, routine work. The grazing program in 1965 was little changed from the
    previous year. The total grazing use and revenue were up 9% and 7% respectively.",nt"license_title":
